import '../style/App.css';
import Header from './Header';
import Mecze from './Mecze';
import Obstawianie from './Obstawianie';
import Footer from './Footer';
import { useState } from 'react';

function App() {
    const [bettingOdds, setBettingOdds] = useState(1);

    return (
        <div className="App">
            <Header />
            <Mecze />
            <Obstawianie bettingOdds={bettingOdds} setBettingOdds={setBettingOdds} />
            <Footer />
        </div>
    );
}

export default App;
